ent":"Tropical Storm Henri socked the Northeast with heavy wind and rain as it made landfall Sunday on the coast of Rhode Island, knocking out power to over 100,000 homes and causing deluges that closed bridges, swamped roads and left many people stranded in their vehicles.\n\nThe storm was downgraded from a hurricane before reaching New England, leaving many to breathe a sigh of relief in a region that has not taken a direct hit from a hurricane in decades. There were few early reports of major damage due to wind or surf.\n\nBut the storms heavy, sustained rains raised concerns about flooding from the storm that threatened to stall over the region before pivoting to the East and moving out to the Atlantic Ocean on Monday night. Some of the highest rain totals were expected inland.\n\nBy Sunday afternoon, Henri had sustained winds of about 50 mph as it moved inland across Connecticut, according to the National Hurricane Center. When it made landfall near Westerly, R.I., it had sustained winds of about 60 mph and gusts of up to 70 mph.\nREAD MORE: https://6abc.com/henri-hurricane-trop...","commandRuns":[{"startIndex":1051,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBoQ040EGAIiEwjO05jHka6AAxWE6pQJHTPoDKNI3bionfCo_Mc6","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnVLTjhRVG1FLU10ZWhfV0Z5Zmxwdi1MRU5DQXxBQ3Jtc0tubEVHd3I2VWtVUlRsVE0wTFIzVlpsTWs5bHhoamxuVmhSaHkzdHNkVGVjTkdNUjZKZlRkV1BIU0t5ZXFLT3dPZUFlVHh1ckF1ZENaMXprVzNZSEo3dlBNYnJocmVrdjRkMG1GQ0t3dXR2ZVdWMmdjNA\u0026q=https%3A%2F%2F6abc.com%2Fhenri-hurricane-tropical-storm-princeton-junction%2F10967709%2F\u0026v=Oo_xRwOqHF0","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnVLTjhRVG1FLU10ZWhfV0Z5Zmxwdi1MRU5DQXxBQ3Jtc0tubEVHd3I2VWtVUlRsVE0wTFIzVlpsTWs5bHhoamxuVmhSaHkzdHNkVGVjTkdNUjZKZlRkV1BIU0t5ZXFLT3dPZUFlVHh
